// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

library ECRecovery {
    function recover(bytes32 hash, bytes memory signature) internal pure returns (address) {
        require(signature.length == 65, "Invalid signature length");

        bytes32 r;
        bytes32 s;
        uint8 v;

        assembly {
            r := mload(add(signature, 32))
            s := mload(add(signature, 64))
            v := byte(0, mload(add(signature, 96)))
        }

        if (v < 27) {
            v += 27;
        }

        require(v == 27 || v == 28, "Invalid v value");

        return ecrecover(hash, v, r, s);
    }

    function toEthereumSignedMessageHash(bytes32 hash) internal pure returns (bytes32) {
        return keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n32", hash));
    }

    function verify(bytes32 hash, bytes memory signature, address publicKey) internal pure returns (bool) {
        return recover(hash, signature) == publicKey;
    }
}

contract VerificationProofStark {
    struct User {
        string name;
        string email;
        string country;
    }

    mapping(address => User) public users;
    mapping(address => bool) public isVerified;

    bytes32 public expectedProofHash;
    bytes32 public publicKeyHash;

    event Debug(string message, bytes32 value);
    event DebugAddress(string message, address value);

    constructor(bytes32 _expectedProofHash, bytes32 _publicKeyHash) {
        expectedProofHash = _expectedProofHash;
        publicKeyHash = _publicKeyHash;
    }
    function verifySignature(bytes32 calculatedProofHash, bytes memory signature, address publicKey) public view returns (bool) {
        // Verificar que el hash calculado coincida con el hash esperado
        require(calculatedProofHash == expectedProofHash, "Proof hash does not match");

        // Calcular el hash firmado con el prefijo Ethereum
        bytes32 ethSignedMessageHash = ECRecovery.toEthereumSignedMessageHash(calculatedProofHash);

        // Verificar la firma utilizando la clave pública proporcionada
        bool isValid = ECRecovery.verify(ethSignedMessageHash, signature, publicKey);

        require(isValid, "Invalid signature");

        return true;

        return true;
    }

    /*function verifyProofAndSignature(bytes32 calculatedProofHash, bytes memory signature) public returns (bool) {
        // Verificar que el hash calculado coincida con el hash esperado
        require(calculatedProofHash == expectedProofHash, "Proof hash does not match");

        // Recuperar la clave pública de la firma usando ecrecover
        address recoveredSigner = recoverSigner(calculatedProofHash, signature);
        
        // Verificar que el hash de la clave pública recuperada coincida con el publicKeyHash
        bytes32 recoveredPublicKeyHash = keccak256(abi.encodePacked(recoveredSigner));
        require(recoveredPublicKeyHash == publicKeyHash, "Invalid signer");

        return true;
    }*/

    function getEthSignedMessageHash(bytes32 _messageHash) public pure returns (bytes32) {
        return keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n32", _messageHash));
    }

    function splitSignature(bytes memory sig) public pure returns (bytes32 r, bytes32 s, uint8 v) {
        require(sig.length == 65, "Invalid signature length");

        assembly {
            r := mload(add(sig, 32))
            s := mload(add(sig, 64))
            v := byte(0, mload(add(sig, 96)))
        }
    }
}

